If strong hold gels leaves your hair a little too stiff or crunchy, you might like a medium hold gel instead! 

These are a few of my personal favorite medium hold gels: 

@notyourmothers curl talk sculpting gel 

@olaplex No.10 bond shaper curl defining gel

@lusbrands all-in-one styler 

@ouidad advance climate control heat + humidity gel 

& if you have a strong hold gel that you need to use up, try mixing it with a bit of water to thin it out & soften the hold!

